import styled from "styled-components";

export const SmallImage = styled.img`
  width: ${(props) => (props.press ? 1000 : 300)}px;
  height: ${(props) => (props.press ? 600 : 180)}px;
  margin: 10px;
  border-radius: 5px;
  cursor: pointer;
`;

export const LargeImage = () => {};
